import { useState } from "react";
import Navbar from "./Navbar";


const Developers = () => {
    
    const [editedFields, setEditedFields] = useState({
      _id: "",
      password: "",
      username: "",
      name: "",
      email: "",
      skills: [],
      rating: 0,
      project_ids: [],
    });

// 
        return (
          <div>
            <Navbar />
            <div className="container bg-dark-subtle mt-5 py-5 border border-warning">
              <div className="text-center text-warning-emphasis">
                <h1>View Lost & Found Items</h1>
              </div>
              <div className="p-5 row">
                {items.map((item) => (
                  <div
                    key={item._id}
                    className="card border-warning mt-5 p-4 col-5 mx-auto"
                  >
                    <div className="card-body">
                      <h5 className="card-title">{item.name}</h5>
                      <p className="card-text">
                        Description :{" "}
                        <span className="fw-bold">{item.description}</span>
                      </p>
                      <p className="cart-text">
                        Resolved ?{" "}
                        <span className="fw-bold">
                          {item.status ? "Yes" : "No"}
                        </span>
                      </p>
                      <p className="card-text">
                        <small className="text-body-secondary">
                          Added on {item.time.substr(0, 10)} by{" "}
                          <a
                            className="link-primary link-offset-2 link-underline-opacity-25 link-underline-opacity-100-hover"
                            href={`http://localhost:3000/profile/${item.userReporting.email}`}
                          >
                            {item.userReporting.name}
                          </a>
                        </small>
                      </p>
                    </div>
                    <img
                      src={item.photoURL}
                      className="card-img-bottom"
                      alt="..."
                    />
                  </div>
                ))}
              </div>
            </div>
          </div>
        );
}

export default Developers;
